column8:
大人気のラルフローレン　オーガニックコットントートが再入荷いたしました♪<br>
<br>
従来の横長のタイプから縦長に仕様変更されております。<br>
<br>
軽くて丈夫で小さく畳めるのでとても便利ですよ！<br>
<br><br>
カラー：ナチュラル×グリーン<br>
サイズ：横38cm×縦41cm×幅13cm<br>
